var wu_check_pass_strength=function(s,t){var r=jQuery(s).val(),e=jQuery(t).val();if(jQuery("#pass-strength-result").removeClass("short bad good strong"),r)switch(wp.passwordStrength.meter(r,wp.passwordStrength.userInputBlacklist(),e)){case 2:jQuery("#pass-strength-result").addClass("bad").html(pwsL10n.bad);break;case 3:jQuery("#pass-strength-result").addClass("good").html(pwsL10n.good);break;case 4:jQuery("#pass-strength-result").addClass("strong").html(pwsL10n.strong);break;case 5:jQuery("#pass-strength-result").addClass("short").html(pwsL10n.mismatch);break;default:jQuery("#pass-strength-result").addClass("short").html(pwsL10n.short)}else jQuery("#pass-strength-result").html(pwsL10n.unknown)};